    return (
        <div className="flex justify-center flex-col items-center" style={{fontFamily: 'Source Code Pro'}}>
            <div className="card">
                <img src="https://www.elegantthemes.com/blog/wp-content/uploads/2020/08/000-http-error-codes.png" class="card-img-top" alt="..."/>
                <div class="card-body">
                    <h1>PAGE NOT FOUND</h1>                
                </div>
            </div>
        </div>
    );
}
